import styled from 'styled-components';
// import { shade } from 'polished';

export const ImportFileContainer = styled.section`
  background: #fff;
  margin-top: 40px;
  border-radius: 5px;
  padding: 64px;
`;

export const H2 = styled.section`
  color: #011936;
  font-size: 20 px;
`;

export const Footer = styled.section`
  margin-top: 36px;
  /* margin-bottom: -20px; */
  display: flex;
  align-items: center;
  justify-content: space-between;

  p {
    display: flex;
    align-items: center;
    font-size: 12px;
    line-height: 18px;
    color: #969cb3;

    img {
      margin-right: 5px;
    }
  }
`;
